import Navigation from './components/Navigation/Navigation';
import AOS from 'aos';
import Feature from './components/Feature/Feature';
import 'bootstrap/dist/css/bootstrap.min.css';
const App = () => {
  useEffect(() =>{
    AOS.init({
      once: true
    });
  }, [])
  return (
    <>
      <Navigation/>
      <Feature/>

    </>
  );
}

export default App;
